// src/components/UserTable.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Navbar from '../';

function UserTable() {
    const [users, setUsers] = useState([]);

    useEffect(() => {
        fetchUsers();
    }, []);

    const fetchUsers = () => {
        axios.get('http://localhost:3002/SignUp/view')
            .then(response => setUsers(response.data))
            .catch(error => console.error('Failed to fetch users:', error));
    }

    const deleteUsers = (id) => {
        if (!id) {
            console.error('Attempted to delete user without an ID');
            return;
        }

        axios.delete(`http://localhost:3002/SignUp/delete/${id}`)
            .then(() => {
                setUsers(users.filter(user => user.id !== id));
                console.log('User deleted successfully');
            })
            .catch(error => console.error('Failed to delete user:', error));
    }

    return (
        <div className="user-management-container">
            <Navbar />
            <div className="user-table-container">
                <table className="user-table">
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Email</th>
                            <th>Role</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {users.map(user => (
                            <tr key={user.id}>
                                <td>{user.userName}</td>
                                <td>{user.email}</td>
                                <td>{user.Role}</td>
                                <td>
                                    <button onClick={() => alert('Edit functionality not implemented')}>Edit</button>
                                    <button onClick={() => deleteUsers(user.id)}>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default UserTable;
